demo.repl.help:
الأوامر المتاحة:
  @show              ─ عرض آخر ملخص للبطاقة التكيفية
  @json              ─ إخراج قيمة JSON الخام المستلمة من التدفق
  @back              ─ الرجوع إلى البطاقة/المدخلات المحجوبة السابقة
  @input <k>=<v>     ─ تعيين أو تجاوز حقل إدخال
  @click <action_id> ─ إرسال البطاقة بالإجراء المقدم
  @help              ─ طباعة نص المساعدة هذا
  @quit              ─ الخروج من REPL
